script: |
  super -f text -I q289.spq | sort > q289.out

inputs:
  - name: q289.spq
    data: |
      SELECT ALL - col2 / col2 AS col2 FROM tab0 (FORMAT parquet) WHERE ( - col2 * - col0 + - col2 / col2 ) NOT IN ( - col0 * - col2 );
  - name: tab0

outputs:
  - name: q289.out
    data: |
      -1
      -1
      -1
